export function bfs(startNode,FinsihNode) {

  const queue = [];
  
  startNode = FinsihNode;
  startNode.isvisited = true;
  queue.push(startNode);

  while(queue.length > 0) {
    let current = queue.shift();
    if(current == FinsihNode) {
      console.log ('found');
    }

  }


}
